import { StyleSheet } from 'react-native'

export const Styles = StyleSheet.create({
    Container:{
        height:"40%"
    },
    IconContainer:{
        width:"100%",
        justifyContent:'space-between',
        padding: 20,
        alignItems: 'center',
        display: 'flex',
        flexDirections: 'row',
        position: 'absolute',
        zIndex: 1
    }

});
